import './App.css';

function App() {
  const renderSearchBar = () => {
    return (
      <form>
        <input type='text' placeholder='Paste listing URL'></input>
      </form>
    );
  };

  return (
    <div className='App'>
      Test
      {renderSearchBar()}
    </div>
  );
}

export default App;
